@param pool pool leveraged from
@param underAuction whether the position is under auction
@param isToken0 if output is in token0 or token1
@param totalDebtOutput debt in output token
@param totalDebtInput debt in input token
@param recentPremium premium paid since last repayment (depcreated atm)
@param openTime creation time for the position
@param lastPremiumPaymentTime is the last time premium has been paid to poolmanager, needed to get TWAT
@param borrowInfo array of ticks and liquidity borrowed from each of those ticks, in addition to utilization information for each

@param margin margin/collateral paid by the trader
@param minOutput is minimum output after incurring slippage price, needs to be computed on the interface using current price
@param positionIsToken0 true if the token escrowed is token0, and the collateral/margin is in token1
@param borrowAmount amount of input token to borrow, if positionIsToken0 then will be in token1.
@param executionOption 1 for uniswap execution, 2 for aggregator execution, 3 for filler execution
@param minEstimatedSlippage used by the matching engine to estimate the minimum target price to match for
 ( (borrowAmount + margin) * current price of pool - actual output) / (borrowAmount + margin) * current price of pool
@param executionData is trade route calldata
 @dev params filler needs to specify is the following
    - minEstimatedSlippage
    - positionIstoken0
    - executionOption
    - trader
    - slippedTickMin
    - slippedTickMax

@param positionIsToken0 true if the token escrowed is token0, and the collateral/margin is in token1
@param reducePercentage fraction of position to be reduced in wad
@param minOutput is minimum output after trading with slipped price, needs to be computed on the interface using current price
   it is reducePercentage * totalPosition multiplied(or divided) current price
@param trader address of the trader
@param executionOption 1 for uniswap execution, 2 for aggregator execution, 3 for filler execution
@param executionData is trade route calldata
@param slippedTickMin is the minimum tick that the pool needs to be in when function is called, computed on the interface
@param slippedTickMax is the maximum tick that the pool needs to be in when function is called, computed on the interface
@dev params filler needs to specify is the following
   - positionIsToken0
   - trader
   - executionOption
   - slippedTickMin
   - slippedTickMax

@param premium premium owed since last repayment
@param returnedAmount amount of input token returned (if positionIsToken0 then will be in token1)
@param repaidDebt0 amount of token0 debt repaid
@param repaidDebt1 amount of token1 debt repaid
@param PnL percentage profit and loss
